pragma solidity ^0.4.23;


contract Grape {
    uint256 concertID = 0;
    uint256 ticketID = 0;

    struct TicketType {
        string ticketName;
        uint256 ticketPrice;
        string ticketDescription;
        uint256 ticketAmount;
    }

    struct Concert {
        uint256 concertId;
        address creator;
        string name;
        string term;
        string ownerName;
        string ticketTypes;
        bool isPossibleAuction;
        string tags;
        uint256 ticketListCount;
    }

    mapping (uint256 => Ticket) ticketList;
    mapping (uint256 => Concert) concertList;

    struct Ticket {
        uint256 concertId;
        address owner;
        string date;
        string auctionHistorys;
        bool isAuction;
    }

    function createConcert(string name, string term, string ownerName, string ticketTypes, bool isPossibleAuction, string tags) 
    public payable returns(uint256 concertID){
        concertList[concertID] = (Concert(concertID, msg.sender, name, term, ownerName, ticketTypes, isPossibleAuction, tags, 0));
        concertID = concertID++;
    }
    function getConcert(uint256 concertId) public view returns (
        address creator,
        string name,
        string term,
        string ownerName,
        string ticketTypes,
        // string ticketName, uint256 ticketPrice, string ticketDescription, uint256 ticketAmount;
        bool isPossibleAuction,
        string tags,
        uint256 ticketListCount
    )
    {
        creator = concertList[concertId].creator;
        name = concertList[concertId].name;
        term = concertList[concertId].term;
        ownerName = concertList[concertId].ownerName;
        ticketTypes = concertList[concertId].ticketTypes;
        isPossibleAuction = concertList[concertId].isPossibleAuction;
        tags = concertList[concertId].tags;
        ticketListCount = concertList[concertId].ticketListCount;
    }
    function getconcertID() returns (
        uint256 concertID
    ) {
        concertID = concertID;
    }

    function payTicekt(uint256 concertId, uint256 ticketPrice, string ticketName, string date) public payable {
        concertList[concertId].creator.send(ticketPrice);
        ticketList[concertList[concertId].ticketListCount].concertId = concertId;
        ticketList[concertList[concertId].ticketListCount].owner = msg.sender;
        ticketList[concertList[concertId].ticketListCount].date = date;
        ticketList[concertList[concertId].ticketListCount].isAuction = false;
        concertList[concertId].ticketListCount = concertList[concertId].ticketListCount++;
    }
}
